import React from "react";
import styled from "styled-components";
import logo from "./logo.svg";
import "./App.css";


const RedStrong = styled.strong`
  color: red;
`;

function App() {
const mudarCor = ()=>{
  return {
    color: 'red'
  }
  console.log(mudarCor)
};

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          <strong style={setInterval(mudarCor, 2000)}>Blog </strong>
          do Paulo Spiguel
        </h1>
        <p>Em breve mais novidades...</p>
      </header>
    </div>
  );
}

export default App;
